import os
os.environ['LD_LIBRARY_PATH'] += ':/usr/local/cuda/lib64'

import pycuda.autoinit
import pycuda.driver as cuda
import numpy as np
from pycuda.compiler import SourceModule
from datetime import datetime
import matplotlib.pyplot as plt

# Размеры матриц
N = 8192#16384
M = 8192#16384
K = 8192#16384

# Создание матриц на CPU
A = np.random.randn(N, M).astype(np.float32) # матрица для перемножения
B = np.random.randn(M, K).astype(np.float32) # матрица для перемножения
C = np.zeros((N, K)).astype(np.float32) # матрица результирующая

# Компиляция CUDA-ядра
mod = SourceModule("""
  __global__ void matrix_multiply(float *A, float *B, float *C, int N, int M, int K) {
    int row = blockIdx.y * blockDim.y + threadIdx.y;
    int col = blockIdx.x * blockDim.x + threadIdx.x;

    if (row < N && col < K) {
      float sum = 0.0f;
      for (int i = 0; i < M; ++i) {
          sum += A[row * M + i] * B[i * K + col];
      }
      C[row * K + col] = sum;
    }
  }
""")

# Выбор функции из скомпилированного модуля
matrix_multiply = mod.get_function("matrix_multiply")

# Выделение памяти на GPU и копирование данных
d_A = cuda.to_device(A)
d_B = cuda.to_device(B)
d_C = cuda.to_device(C)


threads = [1, 2, 4, 8, 16, 32]

performance_result = {}

for thread in threads:

  # Запуск ядра на GPU
  block_size = (thread, thread, 1) # первые два параметры отвечают за количество параллельных потоков
  grid_size = ((N + block_size[0] - 1) // block_size[0], (K + block_size[1] - 1) // block_size[1])


  # Включаю таймер
  start_time = datetime.now()

  # Перемножаю матрицы
  matrix_multiply(d_A, d_B, d_C, np.int32(N), np.int32(M), np.int32(K), block=block_size, grid=grid_size)

  # Копирование результата на CPU
  A_copy = np.empty_like(A)
  B_copy = np.empty_like(B)
  C_copy = np.empty_like(C)
  #d_C.copy_to_host(C_copy)
  cuda.memcpy_dtoh(A_copy, d_A)
  cuda.memcpy_dtoh(B_copy, d_B)
  cuda.memcpy_dtoh(C_copy, d_C)

  # Выключаю таймер
  execution_time = datetime.now() - start_time
  performance_result[thread] = str(execution_time)
  print("Threads: "+str(thread)+". Performance time: "+str(execution_time))

#print(list(performance_result.keys()))
#print(list(performance_result.values()))

plt.xlabel(r'Threads')
plt.ylabel(r'Performance time')
plt.plot(list(performance_result.keys()), list(performance_result.values()))
plt.show()

